func WriteFile() {
	f, err := os.Create("JoinGameDataPacket")
	if err != nil {
		panic(err)
	}
	f.Write(JoinGamePacket)
	f.Close()
	PR := packet.CreatePacketReader(JoinGamePacket)
	PR.ReadVarInt()
	PR.ReadVarInt()
	EID, err := PR.ReadInt()
	if err != nil {
		panic(err)
	}
	Hardcore, err := PR.ReadBoolean()
	if err != nil {
		panic(err)
	}
	PreviousGM, _ := PR.ReadByte()
	WorldCount, _, _ := PR.ReadVarInt()
	WorldNames, _ := PR.ReadIdentifierArray(int(WorldCount))
	Log.Debugf("EID: %d, Hardcore: %t, PreviousGM: %d, WorldCount: %d, WorldNames: %v", EID, Hardcore, PreviousGM, WorldCount, WorldNames)
	NBTD := nbt.CreateNBTDecoder(PR.ReadRestOfByteArrayNoSeek())
	NBTD.Decode()
}
